import { useState } from "react";

import "./Chart.css";
export const Chart = () => {
  return (
    <div className="chartContainer">
      <h3 className="chartTitle">Godine korisnika</h3>
      <div className="barChart">
        <div className="sideChart">
          <span className="label1">500</span>
          <span className="label2">400</span>
          <span className="label3">300</span>
          <span className="label4">200</span>
          <span className="label5">100</span>
          <span className="label6">0</span>
        </div>
      </div>
    </div>
  );
};
